import axios from "axios";

function getAllUsers() {
	axios.get('http://localhost:3001/user')
  .then(function (response) {
    // handle success
    console.log(response);
	return response.data;
  })
  .catch(function (error) {
    // handle error
    console.log(error);
	return error;
  })
  .finally(function () {
    // always executed
  });
}

const App:React.FC = () =>
{
	const data = getAllUsers();
